import React, { Component } from 'react';
import './App.css';

import {Layout, Header, Navigation, Content, Drawer} from 'react-mdl';


class App extends Component {
  render() {
    return (

    <div className="big-content">

    <Layout>
      <Header title ="Title" scroll>
        <Navigation>
          <a href="/">Link 1</a>
          <a href="/">Link 2</a>
          <a href="/">Link 3</a>
          <a href="/">Link 4</a>
        </Navigation>
      </Header>
      <Drawer title="Title">
        <Navigation>
          <a href="/">Link 1</a>
          <a href="/">Link 2</a>
          <a href="/">Link 3</a>
          <a href="/">Link 4</a>
        </Navigation>
      </Drawer>
      <Content>
        <div className ="Page-Content"/>
      </Content>
    </Layout>






    </div>
    );
  }
}

export default App;
